import login from "="

class App extends Component {
 render() {
   return (
     <div className="App">
     <div className="App-header">
     <img src={logo} className='App-logo' alt='logo' />
      <h2>React signup</h2>

     </div>
     <login />

     </div>

   );
 }

}

export default App;
